import React from "react";
import Footersss from "./components/header";
import logo from "./img/logo.jpg"

class App extends React.Component {
    helpTxt = "Help Text"
    render() {
        return (
    <div>
        <h1>{this.helpTxt}</h1>
        <input className="inputbtn" placeholder={this.helpTxt} onClick={this.inputClick} onMouseEnter={this.inputOver}/>
        <p>{this.helpTxt === "Help Text" ? "Yes" : "No"}</p>
        <Footersss those="Bottom txt"/>
        <img src={logo}/>
    </div>);};

    inputClick () {
        console.log("Clicked!")};
    inputOver () {console.log("Mouse over Input!")};

};

export default App;
